import React from "react";
import { Form } from "react-bootstrap";
import '../selectInput/selectInput.css'

export default function Select({ register, rules, errors, required, options }) {
    return (
        <>
            <div className='form-floating'>
                <Form.Select className={`selectInput ${errors["gender"] && 'error-style'}`} name='gender' aria-label="Default select example" id="gender" name="gender" {...register('gender', { ...rules })}>
                    <option hidden defaultValue={''}></option>
                    {options.map((option,index) => {
                        return (
                            <option key={index} value={option}>{option}</option>
                        )
                    })}
                </Form.Select>
                {errors['gender'] && errors['gender'].type === 'required' && <p className="validation-error">Required field</p>}
                <Form.Label htmlFor='gender'>Gender
                    {required && <span className="reqStar">&nbsp;*</span>}
                </Form.Label>
            </div>
        </>
    )
}
